export class Aluno {
  constructor() {
    this.clean();
  }

  clean() {
    this.nome = "";
    this.cpf = "";
    this.email = "";
    this.metas = new Map();
  }

  clone() {
    var aluno = new Aluno();
    aluno.copyFrom(this);
    return aluno;
  }

  copyFrom(from) {
    this.nome = from.nome;
    this.cpf = from.cpf;
    this.email = from.email;
    this.copyMetasFrom(from.metas);
  }

  copyMetasFrom(from) {
    this.metas = new Map();

    for (let key in from) {
      this.metas[key] = from[key];
    }
  }

}
